INSERT INTO `StaticPage` VALUES (1,'About Us','<p>	Bizverse RentALL is a commercial platform for accommodation services, where service providers can register and rent out their products and services, and buyers can register to use the service. With the authentication of service quality for tenants to create safety for users (KYC and strict authentication). Users of products - services can view and compare prices and quality of products - services, thereby making a decision whether to use the service or not. To ensure the benefits for consumers as well as suppliers, Bizverse RentALL supports payment tools such as Paypal,... thereby bringing absolute benefits and experiences to Bizverse RentALL users.</p><p><br></p><p>	RentALL is a technical solution to entrepreneurs for launching their own rental marketplace platform faster into the market. It is equipped with essential features to run a marketplace where customers can share their properties and also goods easily.</p>','About Us','About Us','2019-07-12 07:58:42','2022-08-30 04:04:01'),(2,'Trust & Safety','<h1><strong>Every home and every experience on RentAll is unique</strong></h1><p><br></p><p>Here are a few ways you can help make sure your trip goes as smoothly as possible</p><p><br></p><p>+ Search &amp; book with confidence: Get exactly what you’re looking for by taking advantage of our many search filters, like price, home type, and amenities. Found a listing you like? Be sure to read the host’s profile and listing or experience description thoroughly—paying special attention to the amenities, house rules or trip requirements, and the cancellation policy.</p><p>+ Read the ratings &amp; reviews: Look through feedback from past guests to help find the right fit for you. You’ll see ratings on several quality dimensions, like cleanliness and accuracy, and detailed reviews with authentic feedback about the experience. Guests can only leave a review after they’ve stayed with that specific host, so you know the feedback you’re seeing is based on actual experiences.</p><p>+ Get your questions answered: Our secure messaging tool is a safe and easy way for you to ask a potential host any questions you have about their home or experience before you book. After booking, you can also message your host to coordinate check-in and stay in touch throughout your trip.</p><p>+ Always communicate &amp; pay on RentAll: Keep yourself, your payment, and your personal information protected by staying on our secure platform throughout the entire process—from communication, to booking and payment. You should never be asked to wire money, provide credit card information or otherwise pay a host directly. If you are, please report it to us immediately.</p><p>+ Do a safety check: Once you’ve arrived at your home or experience, make sure you know where all relevant emergency equipment and safety information is located. If you’re not sure where something like the first aid kit or fire extinguisher is, don’t hesitate to ask your host. It’s always better to be prepared.</p><p>+ Research local travel alerts &amp; warnings: Whether you’re traveling with RentAll or not, it’s always a good idea to research your destination ahead of time, and check with your local embassy in case there are any travel warnings or special requirements. For example, travelers from the United States should check with the State Department for visa information and travel warnings.</p><p>+ We’re here for you 24/7.</p><p><br></p><p>If you arrive at a home or experience and something’s not quite right, reach out to us. We’re standing by 24/7 to help with things like rebooking assistance and refunds or reimbursements.</p><p><br></p><h1><strong>Sharing your space or passions with someone you’ve never met can feel like a leap of faith</strong></h1><p><br></p><p>Here’s how you can help ensure your hosting experience, and your guest’s trip, goes off without a Hitachi</p><p><br></p><p>+ Set clear expectations: Your listing should let potential guests know about the unique features and amenities of your home or experience. Even small details like the number of flights of stairs to your front door or the fitness level required for your experience can help make sure guests enjoy their time with you.</p><p>If you’re a home host, you can also outline specific expectations (like quiet hours) in your house rules.</p><p>+ Set guest requirements: Every guest is asked to provide their full name, date of birth, phone number, email address, and payment information to RentAll before booking. Home hosts also have the option to require guests to provide RentAll with a government ID before booking their listing.</p><p>+ Read profiles &amp; reviews: If you want to know more about a guest before accepting their reservation request, check out their profile or read reviews from past hosts. Hosts and guests can only review each other after a reservation is complete, so you know the feedback you’re reading is based on actual experiences.</p><p>+ Get to know your guest in advance: Our secure messaging tool gives you the chance to get to know guests and answer or ask any questions that come up before or during the trip. Messaging is also a great place to coordinate things like check-in or provide local recommendations.</p><p>+ Keep safety info &amp; equipment handy: It’s important to equip your home or experience and your guests with the safety essentials they might need during their trip. This includes things like a working smoke and carbon monoxide detector (hosts can order a free one here), a fire extinguisher, a first aid kit, and information on how to get in touch with local authorities.</p><p>+ We’re here for you 24/7: In the rare event that an issue should arise, our team is available 24/7 to support you and your guests—all you have to do is reach out. We offer things like rebooking assistance, refunds, reimbursements.</p><p><br></p><h1><strong>Community Standards</strong></h1><p><br></p><p>Creating a world where anyone can truly belong requires a foundation of trust grounded in consistent expectations of host and guest behavior. We’ve established these Community Standards to help guide behavior and codify the values that underpin our global community.</p><p><br></p><p>This is a living document, as we’re constantly refining our approach to meet the needs of our community. But these five standards—safety, security, fairness, authenticity, and reliability—remain central pillars in our efforts to help ensure safety and foster belonging. We’re always working to make sure they’re upheld and enforced.</p><p><br></p><h2><strong>⁕ Safety</strong></h2><p><br></p><p>Your RentAll experience begins the moment you embrace adventure. That’s only possible when you trust this community and feel safe. As a result, we require that you refrain from endangering or threatening anyone.</p><p><br></p><p>• Harming yourself or others: You should not commit physical or sexual assault, sexual abuse, sexual harassment, domestic violence, robbery, human trafficking, other acts of violence, or hold anyone against their will. Members of dangerous organizations, including terrorist, organized criminal, and violent racist groups, are not welcome in this community. RentAll is committed to working with law enforcement as appropriate and responding to valid law enforcement requests.</p><p>We take suicide, self-injury, eating disorders, and hard drug abuse extremely seriously and work to help people in crisis.</p><p>• Threatening anyone: You should not convey an intent to harm anyone by your words or physical actions. We also take threats of self-harm as seriously as we do actions and may intervene if we become aware of a threat.</p><p>• Creating hazardous situations: You should not keep unsecured weapons, disease risks, or dangerous animals in your listing, nor should you create conditions that increase the likelihood of a fire or impede escape in the event of emergency.</p><p><br></p><h2><strong>⁕ Security</strong></h2><p><br></p><p>Our RentAll community members share their homes, neighborhoods, and experiences. Whether you’re opening your home as a host or experiencing a host’s hospitality as a guest, you should trust that you will feel secure. We ask you to respect others’ property, information, and personal belongings.</p><p><br></p><p>• Theft, vandalism, or extortion: You should not take property that isn’t yours, use someone’s property without their permission, copy others’ keys or identity documents, damage others’ property, remain in listings after a stay is concluded, or threaten anyone with bad ratings or any other penalty or harm to obtain compensation or other benefits.</p><p>• Spam, phishing, or fraud: You should not make transactions outside of RentAll’s payments system; commit booking fraud, credit card fraud, or launder money; attempt to drive traffic to other sites or market unrelated products; divert payments meant for others; abuse our referrals system; or make false claims against other members of the community.</p><p>• Violating others’ privacy or intellectual property rights: You should not spy on other people; cameras are not allowed in your listing unless they are previously disclosed and visible, and they are never permitted in private spaces (such as bathrooms or sleeping areas). You should not access others’ accounts without authorization or violate others’ privacy, copyrights, or trademarks.</p><p><br></p><h2><strong>⁕ Fairness</strong></h2><p><br></p><p>The global RentAll community is as diverse, unique, and vibrant as the world around us. Fairness is what holds us together, what makes it possible for us to trust one another, integrate seamlessly within communities, and feel as if can we can truly belong.</p><p><br></p><p>• Discriminatory behavior or hate speech: You should treat everyone with respect in every interaction. So, you should follow all applicable laws and not treat others differently because of their race, ethnicity, national origin, religious affiliation, sexual orientation, sex, gender, gender identity, disability, or serious diseases. Similarly, insulting others on these bases is not allowed.</p><p>• Bullying or harassing others: You should not share personal information to shame or blackmail others, target others with unwanted behavior, defame others, or violate our review and content standards.</p><p>• Disturbing the surrounding community: You should not disturb common spaces, treat neighbors as “front desk staff,” create a pervasive nuisance for those around you, or persistently fail to respond to neighbor or community concerns.</p><p><br></p><h2><strong>⁕ Authenticity</strong></h2><p><br></p><p>Your RentAll experiences should be full of delightful moments and surprising adventures. Since our community is built on trust, authenticity is essential—it requires a balance of shared expectations, honest interactions, and accurate details.</p><p><br></p><p>• Misrepresenting yourself: You should not provide a false name or date of birth, use listings for commercial purposes without your host’s permission, have events or parties without your host’s approval, maintain duplicate accounts, or create an account if you’re under 18.</p><p>• Misrepresenting your spaces: You should not provide inaccurate location information, have incorrect availability, mislead people about the type, nature, or details of your listing, substitute one listing for another, set up fake or fraudulent listings, leave fraudulent reviews, engage in deceptive pricing, or fail to disclose hazards and habitability issues.</p><p>• Experiences that are merely transactions: RentAll began as a way to allow people to share their homes. Though RentAll has grown since the early days, and home sharing has expanded around the world, we still expect that every listing is not just a transaction, but a place for others to belong.</p><p><br></p><h2><strong>⁕ Reliability</strong></h2><p><br></p><p>Every RentAll experience is unique and each detail specific to a home, a neighborhood, and a host. Since our community makes commitments based on these details, we have to be able to trust each other’s reliability—whether it be in timely communication, the condition of the home, or in the expectations we set.</p><p><br></p><p>• Providing uninhabitable spaces: You should not provide spaces with sub-standard cleanliness or undisclosed lack of running water or electricity. You should not provide spaces that are not legitimate sleeping quarters (e.g. camping gear), not stationary for the duration of the stay (e.g. moving boats), or lack access to dedicated restroom facilities (e.g. directing guests to use public bathrooms).</p><p>• Breaking commitments: Absent extenuating circumstances, you should not cancel after the deadline set in the relevant cancellation policy. You should also not fail to make check-in possible, fail to pay, or break the host’s house rules.</p><p>• Being unresponsive: You should not have persistently and pervasively low ratings, be unresponsive during booking or throughout a stay, fail to provide an adequate point of contact for hosting, or refuse to participate in our resolution process.</p>','Trust & Safety','Trust & Safety','2019-07-12 07:58:42','2022-08-30 03:52:32'),(3,'Travel Credit','<h1><a href=\"https://www.breakingtravelnews.com/focus/article/vietnams-planned-hotel-openings/\" rel=\"noopener noreferrer\" target=\"_blank\"><strong>Vietnam’s planned hotel openings</strong></a></h1><p><br></p><p>Vietnam remains one of the top destinations in the world, with growth rates ranging from 50-75%.&nbsp;Since reopening its borders to foreign travel, Vietnam has welcomed over 954,000 international travellers in the first seven months of 2022, representing nearly a ninefold increase over the same period the previous year. Vietnam welcomed 352,600 international tourist arrivals in July 2022, a 49% increase over the previous month, reinforcing the fact that travel to this much-loved destination is certainly on the rise.</p><h1><br></h1><h1><a href=\"https://www.breakingtravelnews.com/focus/article/how-soneva-jani-stays-at-the-top-of-travel-bucket-lists/\" rel=\"noopener noreferrer\" target=\"_blank\"><strong>How Soneva Jani stays at the top of travel bucket lists</strong></a></h1><p><br></p><p>The first thing worth noting about Soneva Jani, is its size. Not the main island itself, which at 150 acres is standard for the destination, but rather that 52 of its 54 villas are located on Chapter One and Chapter Two, two overwater jetties that extend from either side of the island like tentacles.</p><p><br></p><h1><a href=\"https://www.breakingtravelnews.com/focus/article/four-seasons-private-jet-journeys-unveils-new-16-day-asia-adventure/\" rel=\"noopener noreferrer\" target=\"_blank\"><strong>Four Seasons Private jet Journeys unveils new 16 Day Asia Adventure</strong></a></h1><p><br></p><p>Learn the secrets of samurai sword fighting, relax on a private coral island in the Maldives, ascend to the cliffside Tiger’s Nest Monastery, take an exclusive day trip to Angkor Wat, savour a food tour of Hoi An by Vespa</p>','Travel Credit','Travel Credit','2019-07-12 07:58:42','2022-08-30 03:54:04'),(4,'Terms & Privacy','<p></p>','Terms & Privacy','Terms & Privacy','2019-07-12 07:58:42','2019-07-12 07:58:42'),(5,'Help','<h1><strong>Guest:</strong></h1><p><br></p><p><strong>Searching and booking</strong></p><p><br></p><p><strong><em>- Searching for stays:</em></strong></p><p>+ Cottages, cabins, and condos—oh my! You can easily narrow your search using travel dates and filters to find an available listing with the amenities you want. Read the listings for more detail and pinpoint them on the map to check if they’d be a good fit for your trip.</p><p>+ How to search:</p><p>Enter your destination, travel dates, and number of guests, then click or tap Search.</p><p>Filters can help narrow options (ex: price range). Click or tap More filters to view all available filters.</p><p>Click or tap a listing to open it. Read the description, check the available amenities, review the house rules, and read reviews that other guests have left for the Host.</p><p>+ Using the map: The map is a quick way to review the listings in relation to areas of interest. You can zoom in or move around the map to find additional listings that don’t appear at first.</p><p><br></p><p><strong><em>- Listing availability:</em></strong></p><p>+ As long as you enter your destination, travel dates, and number of guests when searching on RentAll, all listings that appear should be available.</p><p>+ You can also consider messaging the Host to confirm availability, along with any other details. We encourage Hosts to keep their calendars up to date, but it doesn’t hurt to check.</p><p>- Saving an Experience or place to a wishlist:</p><p>+ We’ll help you keep track of all the wonderful things you discover on RentAll. Simply click or tap the Heart on any experience or place to stay that you want to keep top of mind.</p><p>+ You’ll have the option to create and name a new wishlist or add it to an existing wishlist.</p><p>+ Managing your wishlists: You can review your wishlists any time. Learn how to manage and share them.</p><p><br></p><p><strong><em>- Managing wishlists: You’ve created a wishlist to keep track of your favorite Experiences and places to stay. So, what’s next?</em></strong></p><p>+ Invite your friends: Get everyone excited by allowing them to add listings or Experiences. You can invite someone to the wishlist by sending them an email or sms, or via social media, or just by copying a link. One thing to note: Anyone with a link to your wishlist can view it. However, those who view it won’t see your name as the Wishlist author and can\'t add or remove RentAll listings from the wishlist.</p><p>+ Remove an Experience or listing from a wishlist: It’s easy to edit your wishlist. Just click or tap the heart on the Experience or listing you want to remove.</p><p><br></p><p><strong><em>- Booking a trip: What to do if you’re new</em></strong></p><p>Welcome to Airbnb! From here, you can go anywhere—but first, a little help to get you on your way.</p><p>+ Introduce yourself: It’s tempting to go straight into search, but first things first: Complete your profile. This gives potential Hosts a chance to learn about you while reviewing your trip requests. Be sure to verify your ID and include a profile photo, too—some Hosts require them</p><p>+ Find your happy place: Is it just us, or is planning a trip almost as fun as going on one? With millions of unique places around the world, you’re destined to find one that has everything you need for a comfortable and memorable stay.</p><p>When searching for a place, include your dates and number of guests to get the most accurate pricing.</p><p>Carefully review the following for each listing:</p><ul><li>Description</li><li>Photos</li><li>Reviews</li><li>House rules</li><li>Amenities</li><li>Cancellation policy</li></ul><p>Feel free to message the Host with any additional questions—they’ll typically respond within 24 hours.</p><p>Once you’ve settled on a place, book it! Each Host has their own style: Some are happy to let you book instantly, while others require you to send a request for approval. Learn how to book and what to expect.</p><p>+ Watch for invites and special offers: If you message a Host about specific dates, they might respond with an invite or special offer. Lucky you! That means you can book immediately right through the message thread, but you’ll want to act fast.</p><p><br></p><p><strong><em>- How to read and send messages:</em></strong> It all starts with a message, whether you have a question about a listing or want to book a stay right away. Getting in touch with a Host starts a message thread you can always go back to, and once you’ve taken that first step, your inbox helps you keep all your communication organized for all your trips. Just go to your Inbox and click on a message thread to read an existing message or send a new one.</p><p>Your reservations</p><p><br></p><p><strong><em>- Check your reservation status as a guest:</em></strong></p><p>Your reservation status keeps you updated on all kinds of things, such as whether you\'re confirmed or need to do something like verify your ID or leave a review. To check it, either find the message thread with the Host in your inbox, or go to Trips and click or tap Show more trip plans, then Show details.</p><p>A Confirmed status means you’re good to go! You’ll receive an email saying so, along with a text (SMS) and a push notification if you have those set up.</p><p>+ Instant Book vs. Request to book: What to expect</p><p>For Instant Book listings, your reservation is automatically confirmed. If you used the Request to book button, Hosts have 24 hours to respond. If they decline or don’t respond, no worries: You won’t be charged and are free to book a different stay. Either way, be sure your account is up to date with valid payment information and your verified ID (Some Hosts require it.)</p><p><br></p><p><strong><em>- Host response time:</em></strong></p><p>+ When you should message your Host</p><p>You’re more than welcome to contact a Host at any time. Sometimes, you’ll have to—other times, it’s simply a good idea.</p><p>Unless you’ve found an Instant Book listing, you’ll have to request that the Host accept your stay. At the Confirm and pay stage of your request, you’ll need to include a brief message about why you’re traveling and when you’ll check-in.</p><p>+ Good times to reach out</p><p>Before sending a trip request: You could send a preemptive hello or double-check that their place is available.</p><p>If you have a question: You should be clear about what to expect. Just check the listing description to make sure the answer isn’t already there.</p><p>+ When you’ll hear from them:</p><p>Hosts have 24 hours to accept or decline your request, but the vast majority reply within 12 hours. Chances are, it’ll be even quicker: More than half of all trip requests are accepted within one hour of the Host reading it.</p><p>You can check the status of your trip request any time you like, but you’ll also receive email updates when things change.</p><p>When a Host confirms your request, your payment will be processed and collected in full by Airbnb. If they decline or let it expire, you won’t be charged and you’re free to book a different stay.</p><p>Need more info from your Host? You can use your Inbox to message the Host or go to your Trips.</p><p>+ Haven’t heard back?</p><p>Most Hosts respond within a few hours, but time zones and lack of internet access might slow things down. In the meantime, try reaching out to other Hosts in the area. Just be careful not to send more than one trip request for the same dates to ensure you don’t end up double booked.</p><p>Don’t want to wait for a Host response? Try Instant Book listings—they allow you to book immediately without needing to send a request to the Host for approval, provided you’ve completed your account setup.</p><p><br></p><p><strong><em>- What happens if my reservation request is declined or expires?</em></strong></p><p>If your reservation request is declined by the host or expires (hosts have 24 hours to respond), no charge is made for the reservation and you’re free to book another place to stay. Find out more about checking the status of your reservation.</p><p>If your reservation request is declined and the listing for the stay shows that it\'s still available, the host’s calendar may not be up-to-date or they may want reservations of a different length or time.</p><p>+Temporary authorizations: Your payment method may be temporarily authorized for a charge when you request a reservation, but this authorization is voided and released back to the payment method if your request is declined or expires. We complete a charge only when a reservation request is confirmed.</p><p><br></p><p><strong><em>- Canceling your reservation for a stay</em></strong></p><p>Your plans have changed and now you need to cancel your reservation. No problem. You can go to your Trips to cancel or make changes to your reservation.</p><p>+ Requesting a refund during your stay: If you’re experiencing an issue during your stay, you can ask your Host to fix it, request a partial refund, or request to cancel your reservation for a full refund. It’s important to submit your request within 24 hours of noticing the issue, and your Host will have 1 hour to respond. If they decline or don’t respond, you can ask Airbnb to step in to help.</p><p><br></p><p><strong><em>- Cancel a trip request:</em></strong></p><p>Change your mind? Here are a few things to know.</p><p>+ Understand when you can cancel: First, check the status of your request. If the Host has already accepted it, then it’s subject to their cancellation policy. If it’s still pending, you can cancel, and you won’t be charged for the reservation or the service fees.</p><p>+ How to cancel a pending trip request: The simplest way is to find the message thread with your Host in your Inbox and select Withdraw request. Otherwise:</p><p><br></p><p><strong><em>- Coordinating check-in with your Host</em></strong></p><p>It’s nearly time to travel, so you’ll want to take care of those final details. Follow these tips to prepare for a smooth check-in.</p><p>+ Before you arrive</p><p>Find your reservation details: Go to your Trips page to find important information, such as the address, your Host’s contact information, and your billing receipt. Check-in information is usually available 3 days before the reservation begins.</p><p>Communicate with your Host: Before your arrival date, message your Host to confirm:</p><p>Check-in and checkout times</p><p>Arrival details</p><p>Key exchange or an alternative method of access</p><p>Contact information and whether either one of you will be without phone or internet access during the trip</p><p>Any other questions you might have</p><p>+ On arrival</p><p>In-person key exchanges: Some Hosts may want to greet you in person to give you the keys or the entry code to their place. If so, look up travel advisories so you can allow extra time to meet up in the event of things like flight delays, bad weather, or road closures.</p><p>Other check-in methods: Other options include:</p><p>Self check-in</p><p>Messaging with instructions to enter</p><p>Leaving keys in a lockbox</p><p>Having a neighbor, Co-Host, or doorperson meet guests</p><p><br></p><p><strong><em>- After your trip: Handling disagreements</em></strong></p><p>Disagreements don’t have to be disagreeable when you have a way to address the issues. Here’s how we can help:</p><p>+ Money-related issues: You can use our Resolution Center within 60 days of your reservation\'s checkout date to request or send money for things related to your Airbnb trip. It helps to have any photos or other relevant evidence ready when you submit a Resolution Center request.</p><p>+ Reviews issues: If you’d like to respond to a review with your perspective of the situation, or to address feedback given, you can leave a response within 30 days of when the review was written. It will post directly below the review and will be visible to the rest of the Airbnb community. If the review is against our policies, you can report it.</p><p><br></p><p><strong><em>- NFT Booking</em></strong></p><p>Especially each Booking corresponds to 1 NFT - thereby increasing the security and clarity of each Booking. After booking, the system will automatically mint the corresponding NFT, from which guests can easily resell the Booking they bought.</p><p><br></p><h1><strong>Host</strong></h1><p><br></p><p><strong>Managing your listing</strong></p><p><br></p><p><strong><em>- Edit your listing:</em></strong></p><p>You can update your listing at any time—things like your listing details, pricing and availability, and more. There are lots of ways to help your guests get a better idea of what your listing offers.</p><p>+You can change the title of your listing whenever you want—it’s your space, so feel free to give it a name that highlights what makes your place special. You’re never locked into a specific listing title.</p><p>+Edit your listing to manage your nightly price, discounts, and more.</p><p>+Your house, your rules! After you’ve listed your place, you can set expectations with your guests, like limits on smoking or permission to bring pets. Your house rules will appear on your listing page and guests will need to agree to them to book your place.</p><p>+You can also customize how your listing is shown on the map to be more general or specific in public search results. But for safety and convenience, always provide confirmed guests with your listing’s exact address and map location.</p><p>-Cancellation policies for your listing</p><p>Sometimes, things come up and guests have to cancel. To keep things running smoothly, you can choose a cancellation policy for each of your listings. When you’re ready to do that, here’s how.</p><p>+Flexible</p><p>Guests can cancel until 24 hours before check-in for a full refund, and you won’t be paid</p><p>If they cancel after that, you’ll be paid for each night they stay, plus 1 additional night</p><p>+Moderate</p><p>Guests can cancel until 5 days before check-in for a full refund, and you won’t be paid</p><p>If they cancel after that, you’ll be paid for each night they stay, plus 1 additional night, plus 50% for all unspent nights</p><p>+Strict</p><p>If they cancel between 7 before check-in, you’ll be paid 50% for all nights</p><p>If they cancel less than 7 days before check-in, you’ll be paid 100% for all nights</p><p>Guests can also receive a full refund if they cancel within 48 hours of booking, if the cancellation occurs at least 14 days before check-in.</p><p><br></p><p><strong><em>- Calculating your payout</em></strong></p><p>Ready to count your earnings? Here’s how it works:</p><p>Your nightly rate plus your optional extra charges (a cleaning fee or extra guest fee, etc.) minus the Host service fee = your received payout.</p><p>This fee is calculated by multiplying the total booking amount by a percentage and then is automatically subtracted from your payout. Your guests do pay a service fee to Airbnb in addition to the cost of your listing. So your guest\'s total price is higher than your payout.</p><p>For more information on your payouts, check out your transaction history.</p><p>+If your payout and set price don’t match</p><p>Your listing price is 100% up to you! Here are some things that can impact your payout:</p><p>Calendar pricing: Weekend pricing or custom calendar pricing</p><p>Length-of-stay discounts: Your weekly or monthly discount</p><p>Long-term reservations: Payments are collected and released in monthly installments</p><p><br></p><p><strong><em>- Get set for your payout</em></strong></p><p>Your bank and payout method will determine how long it will take for your funds to arrive in your account. Be sure to set up at least one payout method for your account!</p><p>Once we’ve sent your funds, a Payout line item will appear for that guest’s reservation. You can always check the status of your payout via your transaction history.</p><p>+Average processing times: As soon as RentAll releases your payout, it’s sent for processing before it arrives with your payment provider. This means some additional time is usually needed for the money to finally settle in your account.</p><p>PayPal: Within 1 business day</p><p>Payoneer Prepaid Debit Card: 1-3 hours</p><p>International wire: 3-–7 business days</p><p>Bank transfer/direct deposit: Up to 7 business days</p><p>+Weekend or holiday delays: Banking systems don’t process transactions on weekends or holidays, so yours will be processed the next business day. Contact your bank directly if you have any questions.</p><p>Your reservations</p><p><br></p><p><strong><em>- How a Host cancels a booking</em></strong></p><p>RentAll guests look forward to their trips, but we understand there are times when you may need to cancel. When you do, we recommend you also send your guest a message as soon as possible.</p><p>If your plans change and you have to cancel a guest\'s reservation, your guest will be notified immediately via email and sent rebooking options similar to your listing.</p><p>You won\'t receive a payout for the canceled reservation, and your guest will be given the opportunity to request a full refund or get help booking a new place.</p><p><br></p><p><strong><em>- If your guest cancels</em></strong></p><p>It happens—plans change! If a guest needs to cancel their reservation, we’re here to help you with a quick rebound.</p><p>+When a guest cancels:</p><p>We’ll notify you immediately</p><p>We’ll unblock the reservation dates</p><p>We’ll coordinate payouts and refunds</p><p>+Cancellation payouts</p><p>If you\'re owed a payout, you\'ll receive it 24 hours after your guest\'s scheduled check-in time.</p><p>If this is your first time hosting, we may hold the payout until 30 days after the reservation was confirmed. Find out more about payouts.</p><p>+Guest refunds</p><p>Guests who cancel will receive an automatic refund if your cancellation policy permits it. Even if it doesn\'t, they may qualify for a refund under our Rebooking and Refund Policy, or if there’s an extenuating circumstance.</p><p>Was your guest\'s stay not up to your hosting standards? Learn how to issue a partial refund.</p><p>+Cancellations after check-in: If a guest cancels after they’ve already checked in, they must vacate your listing immediately, and the terms of your cancellation policy will still apply.</p><p><br></p><p><strong><em>- Decline a trip request</em></strong></p><p>Things come up, and you might not be able to accommodate every request that comes your way. Not a problem—here’s how to handle it.</p><p>Decline the request before it expires within 24 hours—your response rate will thank you! It’s one of the factors that helps you become a Superhost.</p><p>Decide whether to keep the dates blocked or open them up for someone else to book.</p><p>Change your mind? That’s OK, too. Just ask the guest to send a new request, or make their day by sending a special offer or invitation to book.</p><p>You can also decline an inquiry, which prevents the guest from sending a request.</p><p><br></p><p><strong><em>- Respond to a request</em></strong></p><p>Congrats! Someone out there is hoping to call your place home for a little while. You have 24 hours to act on requests before they expire, so set up notifications to ensure you get them as soon as possible.</p><p>+What to expect</p><p>To prevent overlap, the requested dates are automatically blocked on your calendar</p><p>Review the request and accept or decline within 24 hours to keep your response rate up</p><p>If you accept, the dates remain blocked</p><p>If you decline due to scheduling, update your calendar to avoid receiving any further requests for those dates</p><p><br></p><p><strong><em>- Managing guest messages</em></strong></p><p>Hosting starts with a warm welcome, and your first message with your guests sets the tone for your future conversations. Your Host inbox makes it easy for you to connect with guests before, during, and after a trip, and you can contact them by going to your Inbox and selecting a message. (Make sure you switch to Host mode, since you have a separate inbox as a guest) You’re never further than a click or tap away from getting in touch with them.</p><p><br></p><p><strong><em>- Government travel restrictions and advisories</em></strong></p><p>Check the links below to find government orders and decrees. Government responses continue to evolve, so please check back often for updates and rely on your local and national government for the most current information.</p><p><br></p><p><strong><em>- NFT Booking</em></strong></p><p>Especially each Booking corresponds to 1 NFT - thereby increasing the security and clarity of each Booking. Host can mint NFT to buy and sell on Marketplace instead of the regular sale.</p>','Help','Help page description','2020-04-13 11:33:10','2022-08-31 03:45:02'),(6,'Cookie Policy','<p></p>','Cookie Policy','Cookie Policy','2021-02-03 13:01:43','2021-02-03 13:01:43');
